function[EAS_f,EAS_Array,fout] = Simple_EAS_GMMv3(mag,Rrup,Vs30,Ztor,f,f0_1)

    [EAS_f,EAS_Array,fout] = Simple_EAS_GMM_sub(mag,Rrup,Vs30,Ztor,f);

 if ~isempty(f0_1)
    % extrapolation at freq_q
     fcut = log10(f0_1);
     freq_q = logspace(-2,fcut, 50);
     f_c = CalcFc(mag,200);

     % Effective EAS 
     EAS_BA_usable = EAS_Array(fout>max(freq_q));
     f_BA_usable = fout(fout>max(freq_q));

    [freq_q, fas_q] = ExtendFAStoLF(f_BA_usable,  EAS_BA_usable, freq_q, f_c, mag);

     EAS_Array = [fas_q EAS_BA_usable]; 
     fout = [freq_q f_BA_usable];  
 end
 %% 2 corner fc models
end

